        "11. Commission structure": "11. Cơ Cấu Hoa Hồng",
        '11.1. The commission settled to the agent is a percentage of the game betting amount.The exact commission structure is part of this agreement. For details, see the "commission rules" clause.In this case, the Commission is withdrawn to the player’s platform wallet (digital currency), but not directly to other addresses.': '11.1. Hoa hồng được thanh toán cho Đại Lý là một tỷ lệ phần trăm của số tiền đặt cược trò chơi. Cơ cấu hoa hồng chuẩn xác là một phần nội dung của thỏa thuận này. Để biết thêm chi tiết, hãy xem điều khoản "quy tắc hoa hồng". Trong trường hợp này, Hoa hồng được rút về ví nền tảng của người chơi (tiền kỹ thuật số), nhưng không trực tiếp đến các địa chỉ khác.',
