        "12.2. The Company may assign this Agreement, by operation of the law or otherwise, at any time without obtaining the prior consent of the Affiliate.": "12.2. Công ty có thể chuyển nhượng bản Thỏa Thuận này, theo quy định của pháp luật hoặc theo cách khác, vào bất kỳ thời điểm nào mà không cần có sự đồng ý trước của Đại Lý.",
        "13. Non-Waiver": "13. Điều Khoản Không Từ Bỏ",
