        "14. Force Majeure": "14. Trường hợp Bất Khả Kháng",
        "14.1. Neither party shall be liable to the other for any delay or failure to perform its obligations under this Agreement if such delay or failure arises from a cause beyond the reasonable control of and is not the fault of such party, including but not limited to labour disputes, strikes, industrial disturbances, acts of God, acts of terrorism, floods, lightning, utility or communications failures, earthquakes or other casualty. If a force majeure event occurs, the non-performing party is excused from whatever performance is prevented by the force majeure event to the extent prevented. Provided that, if the force majeure event subsists for a period exceeding thirty (30) days then either party may terminate the Agreement without notice.": "14.1. Không bên nào phải chịu trách nhiệm với bên kia về bất kỳ sự chậm trễ hoặc không thực hiện nghĩa vụ của mình theo bản Thỏa Thuận này nếu sự chậm trễ hoặc thất bại đó xuất phát từ nguyên nhân nằm ngoài khả năng kiểm soát hợp lý và không phải do lỗi của bên đó, bao gồm nhưng không giới hạn ở việc tranh chấp lao động, đình công, bạo loạn công nghiệp, thiên tai, hành động khủng bố, lũ lụt, sét đánh, lỗi tiện ích hoặc thông tin liên lạc, động đất hoặc thương vong khác. Nếu trường hợp bất khả kháng xảy ra, bên không thực hiện được miễn trừ bất kỳ trường hợp nào mà việc thực hiện bị ngăn cản bởi sự kiện bất khả kháng trong phạm vi ngăn cản. Với điều kiện là, nếu sự kiện bất khả kháng xảy ra trong thời gian vượt quá ba mươi (30) ngày thì một trong hai bên có thể chấm dứt Thỏa Thuận mà không cần thông báo.",
        "15. Relationship of the Parties": "15. Mối Quan Hệ của Các Bên",
        "15.1. Nothing contained in this Agreement, nor any action taken by any party to this Agreement, shall be deemed to constitute either party (or any of such party's employees, agents, or representatives) an employee, or legal representative of the other party, nor to create any partnership, joint venture, association, or syndication among or between the parties, nor to confer on either party any express or implied right, power or authority to enter into any Agreement or commitment on behalf of (nor to impose any obligation upon) the other party.": "15.1. Không có nội dung nào trong Thỏa Thuận này, cũng như bất kỳ hành động nào được thực hiện bởi bên bất kỳ trong Thỏa Thuận này, sẽ được coi là một trong hai bên (hoặc bất kỳ nhân viên, đại lý hoặc đại diện nào của bên đó) trở thành nhân viên hoặc đại diện hợp pháp của bên kia, cũng như tạo ra bất kỳ quan hệ đối tác, liên doanh, liên kết hoặc hợp tác giữa hoặc giữa các bên, cũng như trao cho bên nào bất kỳ quyền, quyền lực hoặc thẩm quyền rõ ràng hoặc ngụ ý nào để tham gia bất kỳ Thỏa thuận hoặc cam kết nào thay mặt (cũng như không áp đặt bất kỳ nghĩa vụ nào đối với) bên khác.",
        "16. Severability/Waiver": "16. Hiệu Lực Từng Phần / Miễn Trừ",
        "16.1. Whenever possible, each provision of this Agreement shall be interpreted in such a manner as to be effective and valid under applicable law but, if any provision of this Agreement is held to be invalid, illegal or unenforceable in any respect, such provision will be ineffective only to the extent of such invalidity, or unenforceability, without invalidating the remainder of this Agreement. No waiver will be implied from conduct or failure to enforce any rights and must be in writing to be effective.": "16.1. Bất cứ khi nào có thể, mỗi điều khoản của Thỏa Thuận này sẽ được giải thích theo cách có hiệu lực và hợp lệ theo luật hiện hành, nhưng nếu bất kỳ điều khoản nào của Thỏa Thuận này được coi là không hợp lệ, bất hợp pháp hoặc không thể thi hành ở khía cạnh bất kỳ, thì điều khoản đó sẽ không có hiệu lực chỉ trong phạm vi của sự vô hiệu, hoặc không thể thực thi, mà không làm mất hiệu lực phần còn lại của Thỏa Thuận này. Sẽ không có sự miễn trừ nào được ngụ ý đối với hành vi hoặc việc không thực thi bất kỳ quyền nào và phải thể hiện bằng văn bản để có hiệu lực.",
        "17. Confidentiality": "17. Bảo Mật",
