        "17.2. The Affiliate obliges himself/herself not to use the confidential information for any purpose other than the performance of its obligations under this Agreement.": "17.2. Đại lý có nghĩa vụ không sử dụng thông tin bí mật cho mục đích bất kỳ khác ngoài việc thực hiện các nghĩa vụ của mình theo Thỏa Thuận này.",
