        "18.2. In case of any discrepancy between the meanings of any translated versions of this Agreement, the English language version shall prevail.": "18.2. Trong trường hợp có bất kỳ sự khác biệt nào về ý nghĩa của các bản dịch bất kỳ của Thỏa thuận này, phiên bản tiếng Anh sẽ được chọn để áp dụng.",
        "19. Trademarks": "19. Nhãn Hiệu",
