        "6.10. For the sake of clarity the parties specifically agree that upon termination of this Agreement by either party, In addition to the previous unsettled Commissions, the Commissions of the agent will no longer be settled.": "6.10. Để minh bạch rõ ràng, các bên đồng ý cụ thể rằng khi một trong hai bên chấm dứt Thỏa Thuận này, ngoài các khoản Hoa hồng chưa được giải quyết trước đó, Hoa hồng của Đại Lý sẽ không còn được giải quyết.",
        "6.11. The Affiliate shall be exclusively responsible for the payment of any and all taxes, levies, fees, charges and any other money payable or due both locally and abroad (if any) to any tax authority, department or other competent entity by the Affiliate as a result of the commission generated under this Agreement. The Company shall in no manner whatsoever be held liable for any amounts unpaid but found to be due by the Affiliate and the Affiliate hereby indemnifies the Company in that regard.": "6.11. Đại Lý sẽ chịu trách nhiệm độc nhất về việc thanh toán bất kỳ và tất cả các khoản thuế, lệ phí, phí, và khoản tiền bất kỳ khác phải trả hoặc đến hạn ở cả trong nước và nước ngoài (nếu có) cho cơ quan thuế, bộ phận hoặc đơn vị có thẩm quyền bất kỳ khác bởi Đại Lý với tư cách là kết quả của khoản hoa hồng được tạo ra theo Thỏa Thuận này. Công ty sẽ không chịu trách nhiệm pháp lý bất kỳ đối với số tiền bất kỳ chưa được thanh toán nhưng được Đại Lý phát hiện là đến hạn và theo đây Đại Lý sẽ bồi thường cho Công ty về vấn đề đó.",
        '6.2. The commission shall be a percentage of the Game bet amount in accordance with what is set out in the commission structures for the particular product. The calculation is product specific and it is set out in every product-specific commission structure. (see "commission rules" for details)': '6.2. Hoa hồng sẽ là một tỷ lệ phần trăm của số tiền đặt cược Trò Chơi phù hợp với những gì được quy định trong cấu trúc hoa hồng cho sản phẩm cụ thể. Cách tính là dựa theo sản phẩm cụ thể và nó được đặt ra trong mỗi cấu trúc hoa hồng của từng sản phẩm cụ thể. (xem "quy tắc hoa hồng" để biết thêm chi tiết)',
        "6.3. Users can withdraw commissions from the agent system at any time. The commissions will be withdrawn into the platform wallet. Users can also withdraw the platform wallet to any address at any time. (you can check the Commission extraction in the agent system and view transaction records in the platform wallet).": "6.3. Đại Lý có thể rút tiền hoa hồng từ hệ thống đại lý bất cứ lúc nào. Tiền hoa hồng sẽ được rút về ví nền tảng trên trang web. Đại Lý cũng có thể rút tiền trong ví đến địa chỉ bất kỳ vào bất kỳ lúc nào. (Bạn có thể kiểm tra việc trích xuất hoa hồng trong hệ thống đại lý và xem lịch sử giao dịch trong ví nền tảng).",
        "6.4. The commissions will be collected in digital currency and will only be received on the platform wallet.When applying for Withdraw, you must submit the correct wallet address on the “Withdraw” page.If there is an error in calculating the commission, the company has the right to amend the amount at any time and immediately settle the underpaid difference to the agent or recover the overpaid balance from the agent.": "6.4. Tiền hoa hồng sẽ được thu về bằng tiền kỹ thuật số và chỉ có thể nhận được trên ví nền tảng. Khi đăng ký Rút tiền, bạn phải gửi địa chỉ ví chính xác trên trang “Rút tiền”. Nếu xảy ra lỗi trong việc tính toán hoa hồng, công ty có quyền chỉnh sửa số tiền bất kỳ lúc nào và thanh toán ngay phần chênh lệch chưa thanh toán cho đại lý hoặc thu hồi số dư trả thừa từ đại lý.",
        "6.5. Agent Withdraw commission by the Affiliate shall be deemed to be full and the final settlement of the balance due for the period indicated.": "6.5. Hoa hồng Rút tiền của Đại Lý sẽ được coi là đã đầy đủ và là khoản thanh toán cuối cùng của số dư có thời hạn trong khoảng thời gian được chỉ định.",
        "6.6. If the Affiliate disagrees with the balance due as reported, it shall within a period of seven (7) days send an email to the Company to admin@{{host}} and indicate the reasons for the dispute. Or contact customer service through Telegram .Failure to send an email Or contact customer service through Telegram within the prescribed time limit shall be deemed to be considered as an irrevocable acknowledgment of the balance due for the period indicated.": "6.6. Nếu Đại Lý không đồng ý với số dư đến hạn như đã báo cáo, trong vòng bảy (7) ngày hãy gửi email đến admin@{{host}} của Công ty và cho biết lý do tranh chấp. Hoặc liên hệ với bộ phận chăm sóc khách hàng thông qua Telegram. Việc không gửi email hoặc không liên hệ với bộ phận chăm sóc khách hàng thông qua Telegram trong thời gian quy định sẽ được xem là tương đồng với việc nhận thức không thể hủy ngang đối với số dư có thời hạn trong khoảng thời gian chỉ định.",
        "6.7. May delay the Withdrawal request through the agent for up to sixty (60) days, while it investigates and verifies that the relevant transactions comply with the provisions of the Terms.": "6.7. Yêu cầu Rút Tiền thực hiện thông qua đại lý có thể trì hoãn tối đa sáu mươi (60) ngày, trong khi đang điều tra và xác minh các giao dịch có liên quan đều tuân thủ các quy định của Điều Khoản.",
        "6.8. No payment shall be due when the traffic generated is illegal or contravenes any provision of these Terms.": "6.8. Sẽ không có khoản thanh toán nào chi trả khi lưu lượng truy cập được tạo ra là bất hợp pháp hoặc trái với bất kỳ điều khoản nào của các Điều Khoản này.",
        "6.9. The Affiliate agrees to return all commissions received based on fraudulent or falsified transactions, plus all costs for legal causes or actions that may be brought against the Affiliate to the fullest extent of the law.": "6.9. Đại Lý đồng ý trả lại tất cả hoa hồng nhận được dựa trên các giao dịch gian lận hoặc giả mạo, cộng với tất cả các chi phí cho các phát sinh pháp lý hoặc hành động có thể được đưa ra chống lại Đại Lý trong phạm vi tối đa của pháp luật.",
        "7. Termination": "7. Chấm Dứt",
