        "9.1. The Affiliate agrees to defend, indemnify and hold the Company and its affiliates, successors, officers, employees, agents, directors, shareholders and attorneys, free and harmless from and against any and all claims and liabilities, including reasonable attorneys' and experts' fees, related to or arising from:": "9.1. Đại Lý đồng ý bảo vệ, bồi thường và giữ cho Công ty cùng các đại lý, người kế thừa, cán bộ, nhân viên, đại diện, giám đốc, cổ đông và luật sư, sự tự do và vô hại đến từ và chống lại bất kỳ và tất cả các khiếu nại và trách nhiệm pháp lý, bao gồm chi phí hợp lý của luật sư và chuyên gia, liên quan đến hoặc phát sinh từ:",
        "9.2. The Company reserves the right to participate, at its own expense in the defense of any matter.": "9.2. Công ty có quyền tự chi trả cho việc tham gia bảo vệ bất kỳ vấn đề nào.",
